import Layout from '../src/components/Layout';
import { Cookies } from 'react-cookie';

//components

const cookies = new Cookies();

const dashboard = () => {
    return (
        <Layout>
            <div className='main'>
                <div className='container-fluid cabecera'>
                    <div className='content'>
                        <div className='logo'>
                            Hola
                        </div>
                        <div className='opciones'>text-align: center;</div>
                    </div>
                </div>
                <div>Body</div>
            </div>
            <style global jsx>{`
                *{
                    box-sizing: border-box;
                }
                html,
                body,
                body > div:first-child,
                div#__next,
                div#__next > div,
                div#__next > div > div {
                    height: 100%;
                    margin:0; padding:0;
                }

                .main{
                    width: 100%;
                    height: 100%;
                    background: linear-gradient(180deg, #C2C0C0, white);
                }

                .cabecera{
                    width: 100%;
                    height: 5%;
                    border: solid 1px;
                    padding: auto;
                }                

                .cabecera .logo{
                    width: 10%;
                    height: 100%;
                    text-align: center;
                    border: solid 1px;
                }

                .cabecera .logo .content{
                    width: 80%;
                }



                .cabecera .opciones{
                    width: 90%;
                    border: solid 1px;   
                }
            `}</style>
        </Layout>
    );
}

export default dashboard;
